import React from "react";
import "../../App.css";
import Banner from "../../components/Banner/Banner";
import Cards from "../../components/Cards/Cards";
import NavBar from "../../components/NavBar/NavBar";

function HomePage() {
  return (
    <div>
      <NavBar />
      <Banner />
      <Cards />
    </div>
  );
}

export default HomePage;
